import "./body.css";
import img from "../../Care.svg";
import { BsTelephoneOutbound, BsArrowReturnRight } from "react-icons/bs";
import ReactStars from "react-stars";
import { CircularProgressbarWithChildren } from "react-circular-progressbar";
import { FiLink2 } from "react-icons/fi";

function Section4() {
	return (
		<div className=' cont mt-5   justify-content-center'>
			<div className='desc2 '>
				<h1 className='about'>SCHEDULE</h1>
				<h1 className='name mt-2 '>
					let's See <strong>my schedule</strong>{" "}
				</h1>
				<h1 className=' actually '>
					<strong>
						time! When i <span className='patient'>Free.</span>
					</strong>
				</h1>

				<p className='d-flex align-items-center'>
					<BsArrowReturnRight
						style={{
							marginRight: 5,
							width: 20,
							height: 20,
							color: "#0bccc5",
						}}
					/>
					<span className='text'>
						Blandit feugiat viverra est tortor commodo, tellus Neque.{" "}
					</span>
				</p>
				<p className='' style={{ width: "90%" }}>
					Diam, id felis viverra diam. Molestie sollicitudin semper ornare dolor
					augue auctor eget nisl.Lorem ipsum dolor sit.
				</p>
				<h1 className='about'>Medical check-up reviews:</h1>
				<div className='row'>
					<div className='mt-4 mb-4  col-6'>
						<h1 className='piece  fs-6'>
							<FiLink2
								style={{
									marginRight: 5,
									width: 20,
									height: 20,
									color: "#fcf93e",
								}}
							/>{" "}
							Heartbeat Rate
						</h1>
						<h1 className='piece  fs-6'>
							<FiLink2
								style={{
									marginRight: 5,
									width: 20,
									height: 20,
									color: "#fcf93e",
								}}
							/>{" "}
							Heartbeat Rate
						</h1>
					</div>
					<div className='mt-4 mb-4 col-6 '>
						<h1 className='piece  fs-6'>
							<FiLink2
								style={{
									marginRight: 5,
									width: 20,
									height: 20,
									color: "#fcf93e",
								}}
							/>{" "}
							Heartbeat Rate
						</h1>
						<h1 className='piece  fs-6'>
							<FiLink2
								style={{
									marginRight: 5,
									width: 20,
									height: 20,
									color: "#fcf93e",
								}}
							/>{" "}
							Heartbeat Rate
						</h1>
					</div>
				</div>
			</div>
			<div className='bloc2'>
				<img src={img} className='drr' />
				<div className='shadow img2 row'>
					<div className='mt-3 px-3 descri'>
						<h1
							className='text-center fs-6 overflow-hidden'
							style={{ color: "#fcf93e" }}
						>
							Get an appointment
						</h1>
					</div>
				</div>
			</div>
		</div>
	);
}

export default Section4;
